// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract Modifier{
    bool public paused;
    uint public count;
    function setP(bool _pause)external {
        paused = _pause;
    }
    modifier WhenPaused(){
        require(paused,"already paused");
        _;
    }
    function add()external WhenPaused{
        count++;
    }
}

